"Swalla" is a song recorded by American singer Jason Derulo featuring rapper Nicki Minaj and singer Ty Dolla Sign. It was released on February 24, 2017, by Warner Bros. Records, as the first single from Derulo's upcoming fifth studio album. The song was written by Derulo, Minaj, Ty, Ricky Reed, LunchMoney Lewis, Robert Diggs, Jacob Kasher Hindlin, Robin Weisse and Russell Jones.

Derulo previewed "Swalla" in a video posted in August 2016. He officially announced it as a single on January 2, 2017. "Swalla" premiered on February 23, 2017, and was released for digital download on iTunes Store the next day. While talking about the song on the red carpet of the 59th Grammy Awards, Derulo said;

"I never believe in forcing a collaboration. You know, I’m a fan of both of theirs and I thought that they fit the track perfectly. It’s one of those ones that’ll get you up and doing your thing. I feel like it’s gonna stick out on the radio. There’s nothing that sounds like it." <a href="http://www.last.fm/music/Jason+Derulo/_/Swalla+(feat.+Nicki+Minaj+&+Ty+Dolla+$ign)">Read more on Last.fm</a>. User-contributed text is available under the Creative Commons By-SA License; additional terms may apply.
